$GLOBALS["lang"]['A personal area network (PAN) is a computer network used for communication among computer and different information technological devices close to one person. Some examples of devices that are used in a PAN are personal computers, printers, fax machines, telephones, PDAs, scanners, and even video game consoles. A PAN may include wired and wireless devices. The reach of a PAN typically extends to 10 meters. A wired PAN is usually constructed with USB and FireWire connections while technologies such as Bluetooth and infrared communication typically form a wireless PAN.'] = 'Persona isto (PAN) esta kompytila ucita por kommunikado inter komputio kaj malsamaj soatojteknologiaj apotoj preksimaj al unu persona. Kelkaj echemoj de aparatoj kiuj estas uzitaj en PAN estetas personaj komputiloj, printiloj, faksoma actuanoj, Telefonoj, PDAoj, skalanoj, kaj e proporción videoludkonzoloj. PAN POVAS KUDI Dratigijn kaj serratajn parabatojn. (RO 2012 7183) Metita PAN estas kutime koronuita kun USB kaj FireWire ligoj dum teknologioj kiel ekzemt rev new dans.';

$GLOBALS["lang"]['A query is essentially a SQL statement. This statement is run against the database with the automatic addition of the limit, filtered to apply to only those requested items and only those items the user has permission to view. A Query can be created using menu -> Manage -> Queries -> Create Queries. Queries contain an org_id and are hence restricted to the appropriate users. A user must have the org_admin or reporter role(s) to create, update or delete a query. All users can execute a query. A query has a name attribute used for the menu item as well as a menu category attribute. This tells the Open-Audit GUI which submenu to place the query in. There is also menu display which should be set to <i>y</i> to enable the query in the GUI (<i>n</i> to prevent the query from appearing at all). The query would still run if called using its <code>id</code>, regardless of menu displays value.'] = 'C \'est la que se trunve le SQL - deklaro verzoek. ® ® ® ® ® ® ® ® ® ® ® ® ® ® ® ® ® Lek Päringud enhavas org _ id kaj estas ita liagitaj mbH konvenaj uzantoj. Uzanto Hansanda.o la org. Mina sinoiuj uzanoj povas efektivigi päring. Aquery tem nomon atribuzione utiligitan por la menuobjektoj mimo kiel menuokokategoriato............................................................................................................................................................................................................ Tio racntas la Open-GUI kiu submenu por meti la atendon en Eksporstas ankai menuo agenkiu devus esti metita al <i>Бендрижуйе</i> Por epligi la atendon en la GUI () ()<i>Бендрижуйе</i> Por malhelfi la atendon estarado seduz. Expediquete da guidere Bendrijuje <code>id</code>"...';

$GLOBALS["lang"]['A rack is a collection of devices which are assigned a position and height within the rack. A device can optionally have a picture associated with it. A rack is placed in a row. We have created a very granular system for positioning of racks, which is as follows. At the top level (as always) is the Organisation (Org). An Org can have multiple locations (as has always been the case). With the addition of the Racks feature, a location can now contain one or more Buildings. A building can contain one or more Floors. A floor can contain one or more Rooms. A room can contain one or more Rows. This sounds like a lot of work, but defaults are created for you. Create a new Location and the sub-components will be automatically created for you. If you need more items (buildings, rooms, etc) you can add them as you like. A rack can also be part of a <i>pod</i> of racks. The pod attribute works as a tag, rather than a strict hierarchical inheritance model as per buildings, floors, etc.<br><br>Racks are a feature available to Open-AudIT Enterprise licensed customers.'] = 'Arako estas kolektto de aparatoj kiuj rizvas pozestakaj alitecon ene estabelecimento. Aparato povas la defaultvole bildon asociitan kun εi. rako estas metita en vicon. Ni kreis tre grajnecan sistemon por pomociigado de rakoj, kiu estas kiel sekvas. Sur la sopra nivelo (kiel org povas havi multobajn lokojn (kiel Klaram estis la kaz). Kun la aldono de la racks trajto, loko opharpovas enhavi unu scettico multilaj Konstrua. C\'è Konstrua mbH Planko povas enhavi unu epäilty multilaj.ambrojn. Mina sentoambro povas enhavi unu epäilty multilaj rregojn. Tio sonas kiel munte da labo, sed deva transeltoi estas kreitaj por vi. Krei novan Lokon kaj la sub-komponanoj está a sceptomate kreitaj por vi. «Vi bezonas pli da eroj» Повас альдони Arako ankahtihtis povas esti parte <i>Бендрижуйе</i> "Суприменто"<br/><br/>Программа «Lider+»';

