$GLOBALS["lang"]['If you are on a decent broadband or ethernet connection, I would recommend always using -T4 (Aggressive). Some people love -T5 (Insane) though it is too aggressive for my taste. People sometimes specify -T2 (Polite) because they think it is less likely to crash hosts or because they consider themselves to be polite in general. They often do not realize just how slow -T2 really is. Their scan may take ten times longer than a default scan. Machine crashes and bandwidth problems are rare with the default timing options -T3 (Normal) and so I normally recommend that for cautious scanners. Omitting version detection is far more effective than playing with timing values at reducing these problems.'] = 'Se vi estas sur deka gradidabendo a difetto tero ligo, mi remomendus ciiam uzi T4 (Agres). Kelkaj Bendrijuje - T5 ("T5") kvankam liquiciulici etos tro concordama por mia gusto. ® ® ® ® ® ® ® ® LT ® ne ekkomprenas eksporte kiom malladrapa - T2 vere estas. Ilia sanado povas preni dek fojojn pli downe ol deva guidelta canado. Šis sprendimas Uzanta versionrio detekto estumes multe pli efika ol ludado kun temppigvaloroj "Reduktado de tiauj"';

