$GLOBALS["lang"]['Nmap cannot determine whether the port is open because packet filtering prevents its probes from reaching the port. The filtering could be from a dedicated firewall device, router rules, or host-based firewall software. These ports frustrate attackers because they provide so little information. Sometimes they respond with ICMP error messages such as type 3 code 13 (destination unreachable: communication administratively prohibited), but filters that simply drop probes without responding are far more common. This forces Nmap to retry several times just in case the probe was dropped due to network congestion rather than filtering. This slows down the scan dramatically.'] = 'Nmap ® povas Bendrijuje Tiuj hasnoj remoj remoj event), sed intersuliloj kiuj semplicemente fenigas enketojn sen repone ppperones. Tiuj fortoj Nmap por reeniri florajn fojojn Tio Bremsas la sanadon.';

$GLOBALS["lang"]['Nmap places ports in this state when it is unable to determine whether a port is open or filtered. This occurs for scan types in which open ports give no response. The lack of response could also mean that a packet filter dropped the probe or any response it elicited. So Nmap does not know for sure whether the port is open or being filtered. The UDP, IP protocol, FIN, NULL, and Xmas scans classify ports this way.'] = 'Nmap lokas hasnojn en tu gritato kiam estas nekapablla determinami Estas malferma su epäilty suodatin. Tio okazas por sanaj tipoj en kiuj malfermaj hasnoj donas neniun reazion. Thesmanko de responso ankai povis певец ke pakafillo falligis la enketon a.jnan responson εi ellogis. "UDP" (UDP) - "protokolo" ("protokolo") FIN "(" NULL "(" NULL ")" Skanadoj klasifikas "(" hasnojn tiun manieron ").';

