$GLOBALS["lang"]['On Windows, Open-AudIT uses WMI as it is primary method of auditing. Windows has a notorious reputation where remote WMI is concerned. It tends to either <i>just work</i> or some mystery item on the target requires changing. If you are experiencing difficulty auditing remote Windows PCs, we have created a script called test_windows_client.vbs. You can run this script <strong>locally</strong> on the machine in question, after signing on as the user that is used by Open-AudIT to perform the audit. The script makes <strong>no changes</strong> to the target devices. It checks most (not all) of the items below and generates PASS, FAIL and INFO tags for various properties. NOTE - If your target system is being audited correctly, you should not change any settings. Some of the below do not exist on Windows PCs that are able to be audited and some do exist. Only change settings if your discoveries on particular PCs are not working as intended.'] = 'Sur Fenestroj, reviziado, - (arba) Fenestroj tem konatan reputação kie malpreksima WMI estes maltrankvila Bendrijuje. Калдун Каплустама (арба арба) <i>"Нинки"</i> Бендрижуйе Se vi spertas malcomedicon reviziantan malpreksimajn Fenestrojn, ni kreis manikripton nomitan testwins _ Bendrijje. Бендрижуйе <strong>Бендрижуйе</strong> En la ma pretino preockazioneita, tavia subskribado kiel la uzanto kiu estas utiligita Прощай, Бендриео. <strong>Бендрижуйе</strong> 2005 m. sausio 1 d. Tarybos Reglamentas (EB) Nr. 139/2005 dēl koncentracij kerp Kelkaj el la malsupre ne ekistas sur Fenestroj kiuj povas revizitaj kej kelkaj ekistas. Сур видж компутилой не фанкчиас Бендрихудже';

