$GLOBALS["lang"]['Open-AudIT can be run on your server in your data center. It does not need access to the internet at all. Even the installation on Linux where we use the distribution package manager for our prerequisites can be negated by you using an in-house and security team-approved package repository.<br><br>Open-AudIT does not store any of your data in the cloud. Even licensing information can be provided without having to access the internet from the Open-AudIT server.<br><br>Sure, it is easier to allow it to access the internet to download packages (including security fixes) for your distribution, but that is up to you and your security policies. Open-AudIT does not need the internet.'] = 'Ava- Aud.i povas esti prizorgita sur linapáca servilon en via datumcentro. Africano bezonas alron al interreto. - Ни.<br/><br/>2005 m. sausio 1 d. Eruga licenciadinformoj povas et distonigitaj sen devi aliri la interreton de la Open-Portugu-servilo.<br/><br/>Certe estestas pli sujeitosi al εi aliri la Interreton por el apretuti paka.ojn (inkluzive de sekureco Fixas) por via Distributionio esto estas εis vi kaj via segreco politikoj. - Ни.';

