$GLOBALS["lang"]['Open-AudIT has a granular permissions system to determine what a user within Open-AudIT can do, and the items he can do it to. Open-AudIT can be entirely self-contained, or use Active Directory or OpenLDAP for authentication and/or authorization.<br><br>It is entirely up to the administrator of Open-AudIT how they would like the Role Based Access Control to work.'] = 'AVA- Aud Tio tem grajnecan perfeson systemon on determinai kion uzanto ene de opharari, kaj la eroj li povas fari εin. ® ® ® povas esti ® mem-konsterita, katlus uzi Aktivan Adresaron kaptlus OpenLDAP porkonfirma kaj/a.<br/><br/>';

$GLOBALS["lang"]['Open-AudIT has a powerful change detection engine. Any device attributes that are added, removed or changed will be detected and stored. These changes can be reported upon and the relevant data confirmed as to what was expected from your company change and release process.<br><br>When a device is audited, attributes are divided into sections which correspond to tables in the database.<br><br>Each device (computer, router, printer, et al) has an entry in the <code>devices</code> table. Each entry in the devices table has an <code>id</code> column. This value is unique - it is an auto-incrementing id.<br><br>When the audit result is processed, each item in each section has its audit result compared to what is in the database.<br><br>For each section, if the key columns (see below table) contain the identical values, it is considered already installed and has its <code>last_seen</code> attribute updated. No change_log entry is created.<br><br>If any of the key columns do not match, it is considered a new attribute and is inserted. A <code>change_log</code> entry is created if the device had other attributes already present in the table.<br><br>At the completion of the audit processing, any database items that have not been updated (or inserted) are considered to not be present. The <code>current</code> attribute for this item is set to <i>n</i> and a change_log entry is generated.<br><br>So, we can determine if something is currently installed - the current column is <i>y</i>.<br><br>We can determine when something was initially detected - the <i>first_seen</i>.<br><br>We can determine if something was installed after the initial audit - first seen will be different in the component and device tables.<br><br>We can determine if something is not currently installed, but previously was - current = <i>n</i>.<br><br>We can determine the last time we detected an item - last_seen.<br><br>At any given point, we can determine what was on a system - by using the audit_log table and selecting the relevant components based on first_seen and last_seen.<br><br>Each section and its matching key columns are below.<br><br>NOTE - There are some exceptions as detailed below.<br><br>*1 - For network cards, if the computer is a VMware Esx machine it also uses the net_index and connection columns.<br><br>*2 - For partitions, f the computer is an AIX machine, we use the partition name.'] = 'Ava- Aud.i tem um grande detektomororon.<br/><br/>Kiam parato estas revizija, atregutoj estas distitaj en sekciojn kiuj egalrilatas al tablej en la datummazo.<br/><br/> Europos mais saugos tarnyba nustata, kad trūksta tam tikros informacijos apie liekan tyrimus. <code>devices</code> "Mezcla en la tablo man aparatoj havas" <code>id</code> "Tiu Valoro estestas unika" - "εi estas a septo-inklina id".<br/><br/>Kiam® reviziorezulto estas prilboreita sekcio tem sian reviziorezulton komparte kun kio estas en la datummazo.<br/><br/>Бендрижуйе <code>last_seen</code> Actif à εisdatigita. Бендрижуйе:<br/><br/>Estette de la sencaj kolonoj ne egalas, εi estas konsiderita nova atigita a kaj estas enigita. Бендрижуйе <code>change_log</code> Eniro estas kreita se la aparato havis alpijn atrofhojn jam nunaj en la tabelo.<br/><br/>Альтернатыви нуорода <code>current</code> "Atritto por titu obektto estas unacita new" <i>Бендрижуйе</i> Ranso estas generata.<br/><br/>Тиль, Бендрижуйе <i>Бендрижуйе</i>Бендрижуйе<br/><br/>Thomas povas determinai kiam io etis comance detektita <i>®</i>Бендрижуйе<br/><br/>Бендрижуйе <br/><br/>Bendrieoje Roveru io ne estas nuntemppe secresetta, sed anta requesterestis... <i>Бендрижуйе</i>Бендрижуйе<br/><br/>Šio straipsnio 1 ir 2 dalys taikomos mutatis mutandis.<br/><br/>Iu anta.fiksita punkto, Österreipovas determinami ki estis sur sistemo. utiligante la revizoran tablon kaj selektante la medifajn kompontojn bazitaj sur uua<br/><br/> Imitu sekcio kaj... Jaj egalaj esencaj kolonoj estas malsupre.<br/><br/>Eksistas kelkaj esceptoj kiel detal