$GLOBALS["lang"]['Orgs in Open-AudIT are a key item. A user has a primary Org as well as a list of Orgs they can access. A user combines this with a list of assigned roles that define what actions they can take on items assigned to the Orgs they have access to. The combination of a users <i>orgs</i> and <i>roles</i> define what they can and cannot do within Open-AudIT.<br><br>Most items in Open-AudIT are assigned to an Org. Devices, Locations, Networks, etc, etc.<br><br>Orgs can have child Orgs. Think of an organisational chart (tree) structure. If a user has access to a specific Org, most of the time (not always) they also have access to that Orgs descendants.'] = 'Органы по открытому доступу. Узантой. Org mimo kiel lister de Orgas kiun ili povas aliri. Uzanto Kombinastion kun lista de asignitaj roloj difinas kiujn fajn ili povas akcepti erojn asignitaj al la orgs kiujn ili havas aliro al. al. Бендрижуйе <i>Бендрижуйе</i> Бендрижуйе <i>Бендрижуйе</i> Difinas kion ili povas kaj ne povas fari ene de Româí<br/><br/>La plej indenitonàj en Open-neurasignitaj al Org.<br/><br/>Orgoj povas havi Infanon orgs. Se uzanto havas al specia Org, la plei granda parte de la tempo (rev...) ili ankai havas limitu Органы posteuloj.';

