$GLOBALS["lang"]['Our goal with the initial integrations release was specifically for NMIS to Open-AudIT integration to <i>just work</i>. If you are using the programs on Linux, you can literally click a single button to execute the integration. Nothing more is required. Having said that, the integration itself is extremely configurable - so if something is not to your preference, it can easily be changed.'] = 'Nia celo kun la omencaj integrai / 1993 / oj estis spéciforte por NMIS al <i>"Нинки"</i>(OL L 20 van 2015.177, blz. 42). Nenio pli estas bezonata. Дирис Кей, Арба';

$GLOBALS["lang"]['Our new feature called Vulnerabilities gives you the ability to quickly determine if any devices are affected by any CVE (Common Vulnerability Exposure) - but how?<br><br>FirstWave constantly consumes the output from the Nist NVD feed. We take this and apply a few restrictions, then extract the affected programs and build a SQL query for reporting. Your Open-AudIT instance reaches out to FirstWave and requests any new vulnerabilities on a regular basis. When it receives a new vulnerability record, it is run against the database and the result stored. Each time a device is processed, all matching vulnerabilities are again executed and the result stored. This means when viewing a vulnerability list, we do not need to calculate all affected devices - we already have the result. When you view an individual vulnerability record, we do indeed recalculate the result for this singular vulnerability.<br><br>So, you are always up to date!<br><br>In addition to this, we also calculate the result of all vulnerabilities for all devices daily (usually at a quiet time, say 2am).<br><br>In your instance of Open-AudIT, we allow you to select which vendors you care about. i.e. there is no use retrieving vulnerability records from a vendor whose software you do not use or have installed. By default, our vendor list is Adobe, Apple, Cisco, Google, Microsoft, Mozilla, and Redhat.<br><br>This all sounds very simple, but behind the scenes a <b>lot</b> is going on. For instance, the CVE record contains a list of affected software - but those software names do not match what we receive when we audit a computer. A good example is Apache. Typically, a CVE record will say the affected software is http_server. In reality, this appears as apache2 (Ubuntu), httpd (Redhat), Apache HTTP Server (Windows) - and others. So, we have to first determine what is the actual name of the program we receive when we ask a computer, and there may be multiple names. After that we must parse the CVE record and create a matching SQL statement. Allowing for multiple program names as above, and multiple versions, version ranges, and even multiple different pieces of software (an example is Thunderbird and Firefox in a single CVE). And your instance of Open-AudIT must take this and apply Orgs filtering as well. And that is just a single CVE. What about determining which CVEs you have and do not have? What about adding a vendor to the list later? So many things to consider!<br><br>As well as the usual reporting, we also have a few new widgets available for Dashboards, based on Vulnerabilities data.'] = '(RO 2012 7183). Haavus donas al vi la kapablon jejua determinai... uija paratoj estas trafitaj Fare de iu CVE (Komuna haavatavuse kokkupude) - sed kiel?<br/><br/>® ® ® ® konstante konkurmas ® produkta ® prenasion kaj aplikas kelkajn restiktojn, tiam eltiras la trafitayn programmajn kaj konsturas SQL -resitentia ® por raportado. (1) 2005 m. sausio 1 d. «Emaj vundeblecoj noveeri besoin efektivititaj kaj la rezulto stokita» (RO 2012 7183).<br/><br/>"Суприменто"<br/><br/>Aldone al tio, ni ankarealkalculas la rezulton de... iuj vondeblecoj po...<br/><br/>En kautta kazo de open-, ni permes al vi selekti jiu vendistoj vi sorgas. "Vundekleedikojn de vingança kies softvaro vi ne uzas a sceptis". Deta.lte proximo vendristo arba "Adobe" arba "Apple"<br/><br/>Бендрижуйе <b>Бендрижуйе</b> Bendrijuje La CVE rekordo enhavas listan de trafita softvaro... Sed tiaj softvarnomoj ne egalas kion ni rizvas kiam ni revizias kompution.com - modificador Fakasht® tio prezentipriasrer - каджилисий Ni tuhoaa unue determinai ko estas la fakta nomo de la programmo kiun ni risovas kiam ni demandas komption, kaj povas eksporsti multoblaj nomoj. Ttio ni murtaa alazi la CVE-reklodon kaj krei egalan SQL — декларон. Permeado por multoblaj softvaro (эксемпл estas Thunderbird kaj Firefox en ununura CVE). Kazo de open- editi prenavision Kaj apliki nedici filtradon ankadon. Kaj Tio está nur ununura CVE. Kion vi volgende kaj ne havas? Kion aldoni vendiston al Bendrieoje? Мултай аферой.<br/><br/>Mismo kiel la kutima raportado, Johannesië. tem kelkajn novajn vidinad havblajn por Bendrijuje, surbaze de Vulnerabilidade datinoj.';

