$GLOBALS["lang"]['So you have an issue providing Open-AudIT credentials to discover your devices. I have an answer - dont then! Sure, I mean, discovery is the best thing since sliced bread. You do not need to know ahead of time <i>Whats On Your Network</i>. But how can you extract data from devices without providing credentials?<br><br>In the case of computers, an easy option is to copy the appropriate audit script to the target machines and set it to execute on a schedule. More details on the wiki. The machines will send their data to Open-AudIT on that schedule, almost as if you were running discovery. The device simply runs the audit script on a schedule (again, you can read the audit script) as the user you tell it to and sends the output to the server. No credentials are involved at all.<br><br>And now we have Agents for Windows. The advantages of an actual installed Agent are'] = 'Šio straipsnio 1 dá a ir b punktuose nurodyti reikalavimai netaikomi: ojn por malkovri viajn afaratojn. Mi havas responsson - Johannesië! Mi Pensas, ke malkovro estas la pléj bona a.o ekde tran. - Ни. <i>Kio estas sobre</i>"Kylis vi povas eltiri datumojn de aparatoj sen providoni akredita"<br/><br/>Koncerne komputilojn eplifiuti opcio dedes kopii la konvenan reviziomanuskripton al la celma onderhandelingen kaj meti εin por efetivi horaron. Pli da Detaloj Sur VerordVicio. La ma apreinoj sentos siajn datumojn al Open- event en tu horaro, preska La aparato semplicemente prisorgas la reviziomanuskripton en horaro (deno, vi povas legi la reviziomanuskripton) kiel la uzanto vi rakontas εin al kaj sendas produkta. Neniuj akredita.oj está implicado.<br/><br/>(RO 2012 7183). - Ни.';

