$GLOBALS["lang"]['WARNING - When creating a baseline using software policies, at present Centos and RedHat package the kernel using the names <i>kernel</i> and <i>kernel-devel</i>. There can be multiple packages with this name and different versions concurrently installed. Debian based distributions use names like <i>linux-image-3.13.0-24-generic</i>, note the version number is included in the package name. Because RedHat based operating systems use this format and subsequently have multiple identical package names with different versions we currently exclude <i>kernel</i> and <i>kernel-devel</i> from software policies. This may be addressed in a future update.'] = 'HOIATUS — «Dum kredo» («Дум крадо»); <i>Бендрижуйе</i> Бендрижуйе <i>Бендрижуйе</i>Povas ekisti multoblaj paka Debiano bazigis Distributionojn utiligas nomojn kiel <i>Лин-кува- 3,3,0-24-генн</i>Имитаар Красный Шапеу Базигис <i>Бендрижуйе</i> Бендрижуйе <i>Бендрижуйе</i> (OL L 20 van 2015.177, blz. 42).';

