$GLOBALS["lang"]['What about other network devices? Think switches, routers, printers, etc. Obviously, it is best if you can provide some SNMP credentials for these devices. They only need <i>read-only</i> access. But if you do not want to do even that, there is nothing stopping you from running discovery, finding the devices, and making a rule or two to identify them (maybe use MAC Address prefix in combination with open ports, for example). You wont have much information, but you will know they are on the network, what they are, and when the last time they were seen was. You will also see if anything new appears on the network.'] = 'Kio Prieliaj Retaparatoj? C\'è una directive che riguarda la protezione dei lavoratori new. Я <i>Бендрижуйе</i> (OL L 347 van 2013 12 20, blz. 671). Trevante la aparatojn, Kaj farante regulon a reguld du identigi ilin (eble uzi MAC Adresse preficson en Kombinao kun malfermaj hasnoj, ekzemm). Vi tem muita informação, sed vicios ke lilis sur la reto, kion ili estas, kaj kiam lalla tempo ili esti viditaj estis. Vi ankai vidos — Nova aperas sur la reto.';

