$GLOBALS["lang"]['When auditing a Linux device via SSH, some Linux distributions do not allow sudo commands to be passed without a TTY (which we are doing). To completely audit one of these linux distributions it is best to supply the root user credentials. If no root is supplied and sudo without a TTY is not possible, the audit script will be run but will not contain the amount of data as would otherwise. Subsequent audits using root (or run locally using sudo) will therefore provide extra details about the system and generate several <i>changes</i>.'] = 'Dum revisado de Linukse-SSH, Bendrijje - "Linukse- Distributionioj ne permes al 115 kommundoj esti pasitaj sen TY (kiu ni faras). L" community de l "energie nucléaire dans le secteur de l" énergie est une prepreparable à l "utilità de l" énergie nucléaire. Se nim residudas provizita kaj eksterlande sen tty ne estas ebla, la reviziomanuskripto estos prizorgita sed ne enhavas la kvanton de datenoj kiel alie. Postu revizioj uzantaj Româme (katlusega kuro loke uzanta sekson) dispositivo tiaal ekstrajn detalojn pri la sinume kaj suvut multimajn detalojn. <i>Гегевенс ван Гимимо: 1969.820</i>Бендрижуйе';

