$GLOBALS["lang"]['When you enable a Query to be run on a schedule, the query is emailed to your chosen address. You must have set up email via menu -> Admin -> Enterprise -> Email Config. We also have a <i>test email<i> button on that page. Input your details, save it and then test it. You should have a modal box that informs you if it successful or not and obviously a test email should arrive if it is successful. Once you have email configured, your scheduled query can be configured.<br><br>Provide a name, optional description, choose <i>Query</i> type, select the desired query, provide an email address, choose a format and set the schedule.<br><br>Provide an hour (hour only, no minutes as yet), give the task a name (this is not the name of the actual scheduled query itself), select which days you would like the query run, choose which query you would like run, supply an email address and choose a query format and you are done.<br>Queries will be sent with an email body of the query (in html format) and the query attached in the requested format.'] = 'Bendrijos teseis aktai, susija su Bendrijos teses aktais, reglamentujančiais Bendrijos teses aktus, reglamentujančiais Bendrijos teses akttus, reglamentujančius tam tikr. преким. gamyb. gamyb. Репо дитонато Конфиг. (L \'impresja - Retpo ditonato Konfig.) <i>Бендрижуйе<i> - Mémoru viajn detalojn, savi εin kaj poste režisien liukoinen. Vi devus havi modalan skatolon kiu informa vin se liquicipei sukcesa a skatt ne kaj extende testpoto devus alveni se εi estas sukcesa. (OL L 347 van 2013 12 20, blz. 671).<br/><br/>Kondio, Ventspola priskribo, elektrotas <i>Бендрижуйе</i> (OL L 20 van 2015.177, blz. 42).<br/><br/>® ® ® ® ® ® ® (® ® ®) ® (® ® ® ® ®) jjjj<br/>Päringud estos senitaj kun repo pretrotodokoro de la atendo (en formato html) kaj la atendo licita en la petita forma.</i></i>';

